import React from "react";

const Bloctext = props => {
  return (
    <div>
      {props.tuy.map(sisiTest => {
        return (
          <div key={sisiTest.id}>
            <h4>{sisiTest.title}</h4>
            <p>{sisiTest.paragraphe} </p>
          </div>
        );
      })}
    </div>
  );
};

export default Bloctext;
